function sind(theta){
	if(theta%180 == 0){
    	return 0
    }
	return Math.sin(theta*Math.PI/180)
}

function cosd(theta){
	if((theta+90)%180 == 0){
    	return 0
    }
	return Math.cos(theta*Math.PI/180)
}


function acosd(ratio){
	return Math.acos(ratio)*180/Math.PI
}

function atan2d(num1, num2){
	return Math.atan2(num1, num2)*180/Math.PI
}

