    let job_id       = robot_status[Serial.JOB_ID];
    let job_instance = Job.job_id_to_job_instance(job_id);
    let ins_id = robot_status[Serial.INSTRUCTION_ID];
    let ins = ((ins_id >= 0) ? job_instance.do_list[ins_id] : null);
